@atlutd falls 5-1 to @chicagofire ———————————————————————— Atlanta United lost 5-1 to Chicago Fire Wednesday night at @seatgeekstadium . @brvndonvazquez scored his first goal of the season in @mls play. The Fire took the lead in the fourth minute from a corner. Nicolás Gaitán delivered an out swinging ball that met the head of Francisco Calvo and drifted into the left side of the net. Chicago doubled its lead in the seventh minute when @cjsapong buried a low shot into the bottom right corner. ::: Read More ::: LINK IN BIO #uniteandconquer #atlutd #chicagofire #mls

